import React, {Component} from 'react';
import "./style.css";

const pictures = [
    'https://cdn.images.dailystar.co.uk/dynamic/1/photos/755000/620x/cristiano-ronaldo-net-worth-how-much-madrid-player-worth-695569.jpg?r=5c053f491050f',
    'https://www.tsn.ca/polopoly_fs/1.912227!/fileimage/httpImage/image.jpg_gen/derivatives/landscape_620/antoine-griezmann.jpg',
    'https://e00-marca.uecdn.es/assets/multimedia/imagenes/2018/02/03/15176565269601.jpg',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTqa94bKUtifeRx2kxVEZFgTNx3JjEgD1ymNqRP8k8Au9zmLZiz',
    'https://cdn.cnn.com/cnnnext/dam/assets/180713152634-modric-tease-exlarge-169.jpg',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTdAgR4dMl-fUDXgLKKYno6UHTmvNfQfnHHAcQvUUtP7NMpp0OR',
    'http://d3nfwcxd527z59.cloudfront.net/content/uploads/2018/03/29165024/Sergio-Ramos.jpg',
    'https://img.fifa.com/image/upload//pohbrusju6jfbv3gldxc.jpg',
    'https://www.thesouthafrican.com/wp-content/uploads/2018/02/908406770.jpg',
    'https://img.rasset.ie/00111242-500.jpg',
    'https://cdn-s3.si.com/s3fs-public/styles/marquee_large_2x/public/2018/03/19/josef-martinez-hat-trick-atlanta.jpg?itok=qB-IimfC',
    'https://cbsatlanta.files.wordpress.com/2017/05/20170520_atlutd_houston-1662.jpg',
];


class picRender extends Component {
   render() {
    return pictures.map(pic => <img className="photo" src={pic}></img>);
   }
}


export default picRender;
